POST calls/{callId}/gather
Collects a series of DTMF digits from a phone call with an optional prompt. This request returns immediately. When gather finishes, an event with the results will be posted to the callback URL.
Supported Parameters



Parameter
Description
Mandatory




maxDigits
The maximum number of digits to collect, not including terminating digits (maximum 30).
No


interDigitTimeout
Stop gathering if a DTMF digit is not detected in this many seconds (default 5.0; maximum 30.0).
No


terminatingDigits
A string of DTMF digits that end the gather operation immediately if any one of them is detected (default “#”; an empty string means collect all DTMF until maxDigits or the timeout).Example:# : The gather ends if # is detected (this is the default behavior if the terminatingDigits property is not specified)0#* : The gather ends if either 0, #, or * is detectedDon’t forget to encode keypad digits that have special meaning in a URL, like #.
No


tag
A string you choose that will be included with the response and events for this gather operation.
No


prompt.sentence
The text to speak for the prompt (uses the call audio resource defaults). NOTE: encode special characters in the sentence.
No


prompt.gender
The gender to use for the voice reading the prompt sentence (uses the call audio resource defaults).
No


prompt.locale
The language and region to use for the voice reading the prompt sentence (uses the call audio resource defaults).
No


prompt.loopEnabled
When value is true, the audio will keep playing in a loop. Default: false
No


prompt.bargeable
Make the prompt (audio or sentence) bargeable (will be interrupted at first digit gathered). Default: true
No


prompt.fileUrl
The location of an audio file to play (WAV and MP3 supported).
